    false,nt"url": null,nt"notes": "This is a history of St. Vincent Island,
    up to the year that it was bought by the U.S. Fish and Wildlife Service. St. Vincent
    Island is a natural barrier island located eight miles from Apalachicola, Florida.
    Though owned by the federal government now, for most of the history of the United
    States, St. Vincent has been under ownership of private companies or individuals,
    including one multimillionaire patent medicine manufacturer. This article outlines
    the people who first lived on the island including the Franciscan Friars who established
    missions there in 1633, Apalachee Indians, Creek Indians, and Seminole Indians.
    In 1811, the island was bough from the Indians by John Forbes and Company. The island
    changed hands many times; some of the more recent owners include Colonel George
    Hatch, Dr. Raymond Vaugh Pierce, and the Loomis Family. In 1968, the island became
    St. Vincent National Wildlife Refuge.",nt"license_title": "License Not Specified",nt"extras":
